componentsModule.modules.analytics={start:function(){let current=componentsModule.modules.analytics;current.parentElement=document.querySelector("[data-component=analytics]");current.detailsElement=current.parentElement.querySelector("div.component_analytics_details");current.analyticsCheck=current.parentElement.querySelector("[name=component_analytics]");current.detailsCheck=current.parentElement.querySelector("[name=component_analytics_details]");componentsModule.initializeEvent({event:"change",element:current.analyticsCheck,content:function(a){let classList=componentsModule.modules.analytics.detailsElement.classList;if(!!(a.target.checked)){classList.remove("hide")}else{classList.add("hide")}reloadPackery()}})},validate:function(){const a=componentsModule.modules.analytics.serialize();return(typeof a.analytics==="boolean"&&typeof a.analytics_details==="boolean")},serialize:function(){let current=componentsModule.modules.analytics;return{analytics:!!(current.analyticsCheck.checked),analytics_details:!!(current.detailsCheck.checked)}}};